> expo-asset

@fs-eire @JonathanSum 
I went over the code inside [https://github.com/fs-eire/ort-rn-hello-world](https://github.com/fs-eire/ort-rn-hello-world), but unfortunately my project doesn't use expo. I tried to use [RNFS](https://github.com/itinance/react-native-fs), in particular `RNFS.DocumentDirectoryPath`, but I couldn't find my onnx model file under all sub-directories of `RNFS.DocumentDirectoryPath`, which evaluates to `/data/user/0/com.onnxtestbed/files`. Do you by chance know what I did wrong here or have any suggestions on other ways to accomplish the same thing as expo? Thanks!

> If you are not using expo-asset, you need to manually add the model file into your projects (android and ios) as asset (see [this link](https://github.com/expo/expo/blob/main/packages/expo-asset/src/resolveAssetSource.ts) for asset resolve of expo-asset). Specifically, if you are running debug build for android, the model file is served by react native dev server - you need an extra step to "download" the model and save it to a temp user folder and load the model from there.

@fs-eire 
I see, thanks for the suggestion and the insight, I will give it a try.
